import React from "react";
import styles from "../modules/Footer.module.css";

export default function Footer() {
  return (
    <footer className={styles.navBarContainer}>
      <div className={styles.navBarLogo}>DOMAIN SELLER</div>
      <div className={styles.logoContainer}>
        <img className={styles.img1} src="Skynet-21.svg" alt="logo" />
        <p>+</p>
        <img className={styles.img2} src="Handshake-1.svg" alt="logo" />
      </div>
    </footer>
  );
}
